import React from 'react';

const Skills = () => {
  const skills = [
    'Python',
    'SQL',
    'Pandas',
    'NumPy',
    'Power BI',
    'Excel',
    'Tableau',
    'Data Cleaning',
    'Data Visualization',
    'Machine Learning',
  ];

  return (
    <div className="bg-gray-900 text-white min-h-screen py-20 px-6 flex justify-center items-center">
      <div className="max-w-5xl w-full">
        <h2 className="text-4xl font-bold text-center mb-12">My Skills</h2>
        <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6">
          {skills.map((skill, index) => (
            <div
              key={index}
              className="bg-gray-800 border border-gray-700 rounded-lg p-4 text-center text-lg font-semibold hover:bg-pink-500 hover:text-white transition duration-300"
            >
              {skill}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Skills;
